[vc_row][vc_column width="1/1"][header type="default" side="Left" slider_color="motive" title="Class Naming" placement="text-center" level="2" sub_level="1" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0" ct_u_color="inherit" ct_u_font_weight="ct-fw-600"][/vc_column][/vc_row][vc_row type="default" shadow="no" overlay="no" height="200" parallax_ratio="0.1" video_type="mp4" scroll="section" ct_u_color="inherit" ct_u_padding="ct-u-paddingBottom40"][vc_column width="1/1"][vc_column_text]

Syntax: <code>ct&lt;componentName&gt;[--modifierName|-descendantName]</code>

Component driven development offers several benefits when reading and writing HTML and CSS:
<ul>
	<li>It helps to distinguish between the classes for the root of the component, descendant elements, and modifications.</li>
	<li>It keeps the specificity of selectors low.</li>
	<li>It helps to decouple presentation semantics from document semantics.</li>
</ul>
You can think of components as custom elements that enclose specific semantics, styling, and behaviour.

