<code>.ct-myComponent { /* … */ }</code>

<code>&lt;article class="ct-myComponent"&gt; … &lt;/article&gt;</code>
[/paragraph][/vc_column][/vc_row][vc_row type="default" shadow="no" overlay="no" height="200" parallax_ratio="0.1" video_type="mp4" scroll="section" ct_u_color="inherit" ct_u_bg_color="ct-u-backgroundWhite" ct_u_padding="ct-u-paddingBoth80" ct_u_border="ct-u-borderBoth"][vc_column width="4/12"][header type="simple" side="Left" slider_color="motive" title="descendant" placement="text-center" level="3" sub_level="1" font_weight_title="ct-fw-600" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0" ct_u_color="inherit" ct_u_font_weight="ct-fw-600" font_weight="ct-fw-600"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]<small class="ct-fw-700 text-uppercase"><code>ct-[componentName]-[descendantName]</code></small>[/paragraph][/vc_column][vc_column width="8/12"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]A component descendant is a class that is attached to a descendant node of a component. It's responsible for applying presentation directly to the descendant on behalf of a particular component. Descendant names are written in camel case.
<code>
&lt;article class="ct-tweet"&gt;
&lt;header class="ct-tweet-header"&gt;
&lt;img class="ct-tweet-avatar" src="{$src}" alt="{$alt}"&gt; …
&lt;/header&gt;
&lt;div class="ct-tweet-body"&gt; … &lt;/div&gt;
&lt;/article&gt;
</code>[/paragraph][/vc_column][/vc_row][vc_row type="default" shadow="no" overlay="no" height="200" parallax_ratio="0.1" video_type="mp4" scroll="section" ct_u_color="inherit" ct_u_bg_color="ct-u-backgroundGray2" ct_u_padding="ct-u-paddingBoth80" ct_u_border="ct-u-borderBoth"][vc_column width="4/12"][header type="simple" side="Left" slider_color="motive" title="modifier" placement="text-center" level="3" sub_level="1" font_weight_title="ct-fw-600" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0" ct_u_color="inherit" ct_u_font_weight="ct-fw-600" font_weight="ct-fw-600"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]<small class="ct-fw-700 text-uppercase"><code>ct-[componentName]--[modifierName]</code></small>[/paragraph][/vc_column][vc_column width="8/12"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]A component modifier is a class that modifies the presentation of the base component in some form. Modifier names are written in camel case and are separated from the component name by two hyphens. The class is included in the HTML in addition to the base component class.
<code>.ct-personBox{ /* … */ }
/* Default style */
.ct-personBox--default { /* … */ }
.ct-personBox--secundary{ /* … */ }
