</code>[/paragraph][/vc_column][/vc_row][vc_row type="default" shadow="no" overlay="no" height="200" parallax_ratio="0.1" video_type="mp4" scroll="section" ct_u_color="inherit" ct_u_bg_color="ct-u-backgroundWhite" ct_u_padding="ct-u-paddingBoth80" ct_u_border="ct-u-borderBoth"][vc_column width="4/12"][header type="simple" side="Left" slider_color="motive" title="Javascript" placement="text-center" level="3" sub_level="1" font_weight_title="ct-fw-600" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0" ct_u_color="inherit" ct_u_font_weight="ct-fw-600" font_weight="ct-fw-600"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]<small class="ct-fw-700 text-uppercase"><code>ct-js-[targetName]</code></small>[/paragraph][/vc_column][vc_column width="8/12"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]JavaScript-specific classes reduce the risk that changing the structure or theme of components will inadvertently affect any required JavaScript behavior and complex functionality. It is not necessary to use them in every case.
