&lt;a href="/login" class="btn btn-primary ct-js-login"&gt;&lt;/a&gt;
</code>
<strong>JavaScript-specific classes are not, under any circumstances, styled.</strong>[/paragraph][/vc_column][/vc_row][vc_row type="default" shadow="no" overlay="no" height="200" parallax_ratio="0.1" video_type="mp4" scroll="section" ct_u_color="inherit" ct_u_bg_color="ct-u-backgroundGray2" ct_u_padding="ct-u-paddingBoth80" ct_u_border="ct-u-borderBoth"][vc_column width="4/12"][header type="simple" side="Left" slider_color="motive" title="Utilities" placement="text-center" level="3" sub_level="1" font_weight_title="ct-fw-600" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0" ct_u_color="inherit" ct_u_font_weight="ct-fw-600" font_weight="ct-fw-600"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]<small class="ct-fw-700 text-uppercase"><code>ct-u-[targetName]</code></small>[/paragraph][/vc_column][vc_column width="8/12"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]Utility classes are low-level structural and positional traits. Utilities are applied directly to any element; multiple utilities are used together; and utilities are used alongside component classes.

Utilities exist because certain CSS properties and patterns are used frequently. For example: floats, containing floats, vertical alignment, text truncation. Utilities help to reduce repetition and provide consistent implementations.

Utilities use a camel case name, prefixed with a <code>u</code> namespace. What follows is an example of how various utilities can be used to create a simple structure within a component.

<code>
&lt;div class="ct-u-uppercase"&gt;</code>
&lt;p class="ct-u-textTruncate"&gt;{$text}&lt;/p&gt;
&lt;img class="ct-u-block" src="{$src}" alt=""&gt;
&lt;img class="ct-u-block" src="{$src}" alt=""&gt;
&lt;img class="ct-u-block" src="{$src}" alt=""&gt;
&lt;/div&gt;[/paragraph][/vc_column][/vc_row][vc_row type="default" shadow="no" overlay="no" height="200" parallax_ratio="0.1" video_type="mp4" scroll="section" ct_u_color="inherit" ct_u_bg_color="ct-u-backgroundWhite" ct_u_padding="ct-u-paddingBoth80" ct_u_border="ct-u-borderBoth"][vc_column width="4/12"][header type="simple" side="Left" slider_color="motive" title="Polyfills" placement="text-center" level="3" sub_level="1" font_weight_title="ct-fw-600" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0" ct_u_color="inherit" ct_u_font_weight="ct-fw-600" font_weight="ct-fw-600"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]<small class="ct-fw-700 text-uppercase"><code>ct-m-[propertyName]</code></small>[/paragraph][/vc_column][vc_column width="8/12"][paragraph span="no" margin_top="0" margin_bottom="0" padding_top="0" padding_bottom="0"]Mixins generate polyfills for browser prefixed properties. We provide a <code>mixins.css</code> file with the most common browser specific properties.

An example of a border radius mixin:
<code>
.ct-m-borderRadius(@radius) {
-webkit-border-radius: @radius;
-moz-border-radius: @radius;
border-radius: @radius;
}
</code>[/paragraph][/vc_column][/vc_row]

